  return( oddCalc( inv.logit(t0 + t1 + t2 + t4*c)*inv.logit(b0 + b1 + b2*c) + inv.logit(t0 + t1 + t4*c)*(1-inv.logit(b0 + b1 + b2*c)) ) / 
          oddCalc( inv.logit(t0 + t1 + t2 + t4*c)*inv.logit(b0 +      b2*c) + inv.logit(t0 + t1 + t4*c)*(1-inv.logit(b0 +      b2*c)) )  ) }
directEffect   <-function(t0,t1,t2,t4,c,b0,b1,b2){ 
  return( oddCalc( inv.logit(t0 + t1 + t2 + t4*c)*inv.logit(b0 +      b2*c) + inv.logit(t0 + t1 + t4*c)*(1-inv.logit(b0 +      b2*c)) ) / 
          oddCalc( inv.logit(t0 +      t2 + t4*c)*inv.logit(b0 +      b2*c) + inv.logit(t0 +      t4*c)*(1-inv.logit(b0 +      b2*c)) )  ) }

